 var width = 10000,
			height = 10000,
			radius = 25,
			color = d3.scale.linear().domain([0,1,]).range(["#cccccc","#1B9E77",])
var color_border = d3.scale.category20();
              color_border(0);
              color_border(1);
              color_border(2);
              color_border(3);
              color_border(4);
              color_border(5);
              color_border(6);
              color_border(7);
              color_border(8);
              color_border(9);

              color_border(14);
              color_border(15);
              color_border(16);
              color_border(17);
              color_border(18);
              color_border(19);
              
  var pie = d3.layout.pie()
			.sort(null)
			.value(function(d) { return d.value; });

		var arc = d3.svg.arc()
			.outerRadius(function(d) { return d.value; })
			.innerRadius(0);
		
		var zoomFlag = 0;
		
		var svg = d3.select("body").append("svg")
			.attr("width", width)
			.attr("height", height)
			//.style("border", "4px solid black")
			.attr("transform", "translate(5.684341886080802e-14,5.684341886080802e-14) scale(0.9999999999999999)") //TODO
			.call(d3.behavior.zoom().on("zoom", function () {
			svg.attr("transform", "translate(" + d3.event.translate + ")" + " scale(" + d3.event.scale + ")")
			//alert(d3.event.scale)
			if (!zoomFlag && d3.event.scale < 0.6){
				var nodelabels = g.selectAll(".nodelabel")
				nodelabels.text("")
				zoomFlag = 1
			}
			if (zoomFlag && d3.event.scale > 0.6){
				var nodelabels = g.selectAll(".nodelabel")
				.text(function(d){return d.name;});
				zoomFlag = 0
			}
		  }))
		  .on("dblclick.zoom", null)
		  .on("mousedown.zoom", null)
		  .append("g")
			.attr("transform", "translate(5.684341886080802e-14,5.684341886080802e-14) scale(0.9999999999999999)");
		  
		var g = d3.select("g");

		var force = d3.layout.force()
			.charge(-120)
			.linkDistance(100)
			.size([width, height]);

		force.nodes(graph.nodes)
			 .links(graph.links)
			 .start();

		var link = svg.selectAll(".link")
			.data(graph.links)
			.enter().append("line")
			.attr("class", "link");

		var node = svg.selectAll(".node")
			.data(graph.nodes)
			.enter().append("g")
			.attr("class", "node")
			.style("stroke", function(d) { return color_border(d.color_value); })
			.call(force.drag);
			
		var nodelabels = svg.selectAll(".nodelabel") 
			.data(graph.nodes)
			.enter()
			.append("text")
			.attr({"x":function(d){return d.x;},
				  "y":function(d){return d.y;},
				  "class":"nodelabel",
				  "stroke":"black"})
			.text(function(d){return d.name;});
			   
		node.selectAll("path")
			.data(function(d, i) {return pie(d.proportions); })
			.enter()
			.append("svg:path")
			.attr("d", arc)
			.attr("fill", function(d, i) { return color(d.data.group); });;

		force.on("tick", function() {
			link.attr("x1", function(d) { return d.source.x; })
			.attr("y1", function(d) { return d.source.y; })
			.attr("x2", function(d) { return d.target.x; })
			.attr("y2", function(d) { return d.target.y; });

			node.attr("x", function(d) { return d.x; })
				.attr("y", function(d) { return d.y; })
				.attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"});
				
			nodelabels.attr("x", function(d) { return d.x; }) 
				.attr("y", function(d) { return d.y+3; });
		});
  </script>
